script: |
  super -f text -I q7351.spq | sort > q7351.out

inputs:
  - name: q7351.spq
    data: |
      SELECT + + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * 5 + 53 + col1 * - + col0 * - 92 * - - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q7351.out
    data: |
      51
      85
      91
